    class="animated"

    xmlns="http://www.w3.org/2000/svg"

    xmlns:xlink="http://www.w3.org/1999/xlink"
    xmlns:svgjs="http://svgjs.com/svgjs"
  >
    <style>
      svg#freepik_stories-no-connection:not(.animated) .animable {
        opacity: 0;
      }
      svg#freepik_stories-no-connection.animated
        #freepik--background-complete--inject-4 {
        animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomIn;
        animation-delay: 0s;
      }
      svg#freepik_stories-no-connection.animated #freepik--Shadow--inject-4 {
        animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38)
          lightSpeedRight;
        animation-delay: 0s;
      }
      svg#freepik_stories-no-connection.animated #freepik--Floor--inject-4 {
        animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideLeft;
        animation-delay: 0s;
      }
      svg#freepik_stories-no-connection.animated #freepik--Device--inject-4 {
        animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomOut;
        animation-delay: 0s;
      }
      svg#freepik_stories-no-connection.animated #freepik--Character--inject-4 {
        animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
        animation-delay: 0s;
      }
      @keyframes zoomIn {
        0% {
          opacity: 0;
          transform: scale(0.5);
        }
        100% {
          opacity: 1;
          transform: scale(1);
        }
      }
      @keyframes lightSpeedRight {
        from {
          transform: translate3d(50%, 0, 0) skewX(-20deg);
          opacity: 0;
        }
        60% {
          transform: skewX(10deg);
          opacity: 1;
        }
        80% {
          transform: skewX(-2deg);
        }
        to {
          opacity: 1;
          transform: translate3d(0, 0, 0);
        }
      }
      @keyframes slideLeft {
        0% {
          opacity: 0;
          transform: translateX(-30px);
        }
        100% {
          opacity: 1;
          transform: translateX(0);
        }
      }
      @keyframes zoomOut {
        0% {
          opacity: 0;
          transform: scale(1.5);
        }
        100% {
          opacity: 1;
          transform: scale(1);
        }
      }
      @keyframes slideUp {
        0% {
          opacity: 0;
          transform: translateY(30px);
        }
        100% {
          opacity: 1;
          transform: inherit;
        }
      }
    </style>
